import * as yup from 'yup'

const signUpSchema = yup.object().shape({
    name: yup.string().max(30).min(2).required("Name should be atleast of 3 characters"),
    phoneNumber: yup.string().max(15).min(11).required("Phone Number should be atleast of 11 digits"),
    address: yup.string().max(50).min(5).required("Enter right Address.."),
    email: yup.string().max(40).min(6).required("Enter correct Email"),
    password: yup.string().max(12).min(8).required("Password should be atleast of 8 characters")

});

export default signUpSchema
